    const chip = <img src="/pokerchip.png" alt="poker chip" width="100vw" height="50"/>
    return (
        <>
        <div className={styles.row}>
            <div>{chip}</div>
            <div>5{chip}</div>
            <div>10{chip}</div>
            <div>25{chip}</div>
            <div>100{chip}</div>
            <div>500{chip}</div>
            <div>1000{chip}</div>

        </div>
        </>
    )
}
